n            //Identify first two unlike elements(will be swapped)\n            a.forEach((element, index) => {\n                if(element !== b[index]) {\n                    firstElement === null ? firstElement = index : secondElement === null ? secondElement = index : null;\n                }\n            });\n            \n            //If there are two unlike elements, swap them.\n            if(firstElement !== null && secondElement !== null) {\n                [a[firstElement], a[secondElement]] = [a[secondElement], a[firstElement]];\n            }\n            \n            //Assume the arrays are equal.\n            let isEqual = true;\n            \n            //See if any elements are not the same.\n            a.forEach((element, index) => {\n                if(element !== b[index]) {\n                    isEqual = false;\n                }\n            });\n            \n            //Return true or false depending on if arrays are the same now.\n            if(isEqual) return true;\n            \n            return false;\n        }",code:function(e,t){var n=null,r=null;if(e.forEach((function(e,i){e!==t[i]&&(null===n?n=i:null===r&&(r=i))})),null!==n&&null!==r){var i=[e[r],e[n]];e[n]=i[0],e[r]=i[1]}var a=!0;return e.forEach((function(e,n){e!==t[n]&&(a=!1)})),!!a},arguments:{descriptions:[{text:"Array of Integers (No Brackets [])",type:"NumberArray"},{text:"Array of Integers (Same Length As First)",type:"NumberArray"}]}},areSimilar2:{name:"areSimilar2",instructions:"Two arrays are called similar if one can be obtained from another by swapping at most one pair of elements in one of the arrays.\n\n        Given two arrays a and b, check whether they are similar.",codeOutput:"function areSimilar2(a, b) {\n            //Helper function to see if arrays are equal.\n            const arrayCheck = (arr1, arr2) => {\n                for(let i = 0; i < arr1.length; i++) {\n                    if(arr1[i] !== arr2[i]) return false;\n                }\n                return true;\n            };\n            \n            //Go through each element in array a, and compare to the current element of array b.\n            for(let i = 0; i < a.length; i++) {\n                //Once we find an unequal value, traverse through both arrays after this point simultaneously to find a spot where the values are equal and in opposite positions, then swap.\n                if(a[i] !== b[i]) {\n                    for(let j = i + 1; j < b.length; j++) {\n                        if(a[i] === b[j] && b[i] === a[j]) {\n                            [b[i], b[j]] = [b[j], b[i]];\n                            //Run an array check now to ensure only one swap is done.\n                            return arrayCheck(a, b);\n                        }\n                    }\n                }\n            }\n            \n            return arrayCheck(a, b);\n        }",code:function(e,t){for(var n=function(e,t){for(var n=0;n<e.length;n++)if(e[n]!==t[n])return!1;return!0},r=0;r<e.length;r++)if(e[r]!==t[r])for(var i=r+1;i<t.length;i++)if(e[r]===t[i]&&t[r]===e[i]){var a=[t[i],t[r]];return t[r]=a[0],t[i]=a[1],n(e,t)}return n(e,t)},arguments:{descriptions:[{text:"Array of Integers (No Brackets [])",type:"NumberArray"},{text:"Array of Integers (Same Length As First)",type:"NumberArray"}]}},arithmeticExpression:{name:"arithmeticExpression",instructions:"Consider an arithmetic expression of the form a#b=c. Check whether it is possible to replace # with one of the four signs: +, -, * or / to obtain a correct expression.",codeOutput:"function arithmeticExpression(a, b, c) {\n            return a + b === c ? \n            true : \n            a - b === c ? \n            true : \n            a * b === c ? \n            true : \n            a / b === c ? \n            true : \n            false;\n        }",code:function(e,t,n){return e+t===n||(e-t===n||(e*t===n||e/t===n))},arguments:{descriptions:[{text:"Number to Represent 'a'",type:"Number"},{text:"Number to Represent 'b'",type:"Number"},{text:"Number to Represent 'c'",type:"Number"}]}},arrayChange:{name:"arrayChange",instructions:"You are given an array of integers. On each move you are allowed to increase exactly one of its element by one. Find the minimal number of moves required to obtain a strictly increasing sequence from the input.",codeOutput:"function arrayChange(inputArray) {\n            let totalCount = 0;\n            //Start with the beginning of the array.\n            let currentVal = inputArray[0];\n            \n            for(let i = 1; i < inputArray.length; i++) {\n                //Go through each element, compare to last element, and increment if needed (include in the total count)\n                while(inputArray[i] <= currentVal) {\n                    inputArray[i] = inputArray[i] + 1;\n                    totalCount++;\n                }\n                \n                //Store this new element as the one to compare to next.\n                currentVal = inputArray[i];\n            }\n            \n            //Return total number of increments.\n            return totalCount;\n        }",code:function(e){for(var t=0,n=e[0],r=1;r<e.length;r++){for(;e[r]<=n;)e[r]=e[r]+1,t++;n=e[r]}return t},arguments:{descriptions:[{text:"Array of Integers (Without Brackets [])",type:"NumberArray"}]}},concatenateArrays:{name:"concatenateArrays",instructions:"Given two arrays of integers a and b, obtain the array formed by the elements of a followed by the elements of b.",codeOutput:"function concatenateArrays(a, b) {\n            return a.concat(...b);\n        }",code:function(e,t){return e.concat.apply(e,Object(f.a)(t))},arguments:{descriptions:[{text:"Array of Integers (Without Brackets [])",type:"NumberArray"},{text:"Array of Integers (Without Brackets [])",type:"NumberArray"}]}},arrayConversion:{name:"arrayConversion",instructions:"Given an array of 2k integers (for some integer k), perform the following operations until the array contains only one element:\n\n        On the 1st, 3rd, 5th, etc. iterations (1-based) replace each pair of consecutive elements with their sum;\n        On the 2nd, 4th, 6th, etc. iterations replace each pair of consecutive elements with their product.\n        After the algorithm has finished, there will be a single element left in the array. Return that element.",codeOutput:"function arrayConversion(inputArray) {\n            //Keep track of the 'current' ouput array, which starts as the input.\n            let output = inputArray;\n            //Keep track of whether values are being added nor not.\n            let add = true;\n            while(output.length > 1) {\n                //Build a new array.\n                let thisArray = [];\n                //For each element, decide whether to add or multiply the next two values.\n                for(let i = 0; i < output.length; i += 2) {\n                    if(add) {\n                        thisArray.push(output[i] + output[i + 1]);\n                    } else {\n                        thisArray.push(output[i] * output[i + 1]);\n                    }\n                }\n                //Toggle add/multiply and reset array.\n                add = !add;\n                output = thisArray;\n            }\n            //Return the first/only array value.\n            return output[0];\n        }",code:function(e){for(var t=e,n=!0;t.length>1;){for(var r=[],i=0;i<t.length;i+=2)n?r.push(t[i]+t[i+1]):r.push(t[i]*t[i+1]);n=!n,t=r}return t[0]},arguments:{descriptions:[{text:"Array of Integers With 2^n Number of Elements (No Brackets [])",type:"NumberArray"}]}},arrayMaximalAdjacentDifference:{name:"arrayMaximalAdjacentDifference",instructions:"Given an array of integers, find the maximal absolute difference between any two of its adjacent elements.",codeOutput:"function arrayMaximalAdjacentDifference(inputArray) {\n            let largestDifference = 0;\n            \n            //For every element, get the absolute value of the difference between it and its adjacent element.\n            for(let i = 0; i < inputArray.length - 1; i++) {\n                let thisDifference = Math.abs(inputArray[i + 1] - inputArray[i]);\n                if(thisDifference > largestDifference) largestDifference = thisDifference;\n            }\n            \n            //Return the largest difference.\n            return largestDifference;\n        }",code:function(e){for(var t=0,n=0;n<e.length-1;n++){var r=Math.abs(e[n+1]-e[n]);r>t&&(t=r)}return t},arguments:{descriptions:[{text:"Array of Integers (No Brackets [])",type:"NumberArray"}]}},arrayPacking:{name:"arrayPacking",instructions:'You are given an array of up to four non-negative integers, each less than 256.\n\n        Your task is to pack these integers into one number M in the following way:\n        \n        The first element of the array occupies the first 8 bits of M;\n        The second element occupies next 8 bits, and so on.\n        Return the obtained integer M.\n        \n        Note: the phrase "first bits of M" refers to the least significant bits of M - the right-most bits of an integer. For further clarification see the following example.',codeOutput:'function arrayPacking(a) {\n            //Create binary representation of this number as an array, reverse the order, and join together.\n            let binary = a.map(number => {\n                let thisBinary = number.toString(2);\n                while(thisBinary.length < 8) {\n                    thisBinary = "0" + thisBinary;\n                }\n                return thisBinary;\n            });\n            let binaryJoin = binary.reverse().join("");\n            //Sum up the total by going through each character (from the right), and adding the correct power of 2 to the total.\n            let total = 0;\n            for(let i = 0; i < binaryJoin.length; i++) {\n                if (binaryJoin[binaryJoin.length - 1 - i] === "1") total += (2 ** i);\n            }\n            return total;\n        }',code:function(e){for(var t=e.map((function(e){for(var t=e.toString(2);t.length<8;)t="0"+t;return t})).reverse().join(""),n=0,r=0;r<t.length;r++)"1"===t[t.length-1-r]&&(n+=Math.pow(2,r));return n},arguments:{descriptions:[{text:"Array (4 Elements Max) of Non-Negative Integers (< 256)",type:"NumberArray"}]}},arrayPairSum:{name:"arrayPairSum",instructions:"Given an integer array nums of 2n integers, group these integers into n pairs (a1, b1), (a2, b2), ..., (an, bn) such that the sum of min(ai, bi) for all i is maximized. Return the maximized sum.",codeOutput:"var arrayPairSum = function(nums) {\n            //Sort the numbers from least to greatest\n            nums.sort((a, b) => a - b);\n            \n            //Store the sum.\n            let sum = 0;\n            \n            //Since these numbers are grouped by being sorted, add every other number.\n            for(let i = 0; i < nums.length; i += 2) {\n                sum += nums[i];\n            }\n            \n            return sum;\n        };",code:function(e){e.sort((function(e,t){return e-t}));for(var t=0,n=0;n<e.length;n+=2)t+=e[n];return t},arguments:{descriptions:[{text:"Array of Integers with Even Length (e.g 5,3,9,1,0,2)",type:"NumberArray"}]}},arrayPreviousLess:{name:"arrayPreviousLess",instructions:"Given array of integers, for each position i, search among the previous positions for the last (from the left) position that contains a smaller value. Store this value at position i in the answer. If no such value can be found, store -1 instead.",codeOutput:"function arrayPreviousLess(items) {\n            let output = items.map((item, index) => {\n                //Traverse backwards in items from this position until we find (or not find) a value less than the current element.\n                let thisElement = -1;\n                //If we find one, replace -1 with that value.\n                for(let i = index - 1; i >= 0; i--) {\n                    if(items[i] < item) {\n                        thisElement = items[i];\n                        break;\n                    }\n                }\n                return thisElement;\n            }); \n            return output;\n        }",code:function(e){return e.map((function(t,n){for(var r=-1,i=n-1;i>=0;i--)if(e[i]<t){r=e[i];break}return r}))},arguments:{descriptions:[{text:"Array of Integers (No Brackets [])",type:"NumberArray"}]}},arrayReplace:{name:"arrayReplace",instructions:"Given an array of integers, replace all the occurrences of elemToReplace with substitutionElem.",codeOutput:"function arrayReplace(inputArray, elemToReplace, substitutionElem) {\n            //Loop through every element. Using map, return the new element if the element matches the one to be replaced. Otherwise, return the same.\n            let output = inputArray.map(element => {\n                if(element === elemToReplace) {\n                    return substitutionElem;\n                } else {\n                    return element;\n                }\n            });\n            return output; \n        }",code:function(e,t,n){return e.map((function(e){return e===t?n:e}))},arguments:{descriptions:[{text:"Array of Integers (No Brackets [])",type:"NumberArray"},{text:"Number to Replace",type:"Number"},{text:"Number to Replace With",type:"Number"}]}},avoidObstacles:{name:"avoidObstacles",instructions:"You are given an array of integers representing coordinates of obstacles situated on a straight line.\n\n        Assume that you are jumping from the point with coordinate 0 to the right. You are allowed only to make jumps of the same length represented by some integer.\n        \n        Find the minimal length of the jump enough to avoid all the obstacles.",codeOutput:"function avoidObstacles(inputArray) {\n            let maxAmount = Math.max(...inputArray);\n            for(let i = 2; i < inputArray.length + i - 1; i++) {\n                \n                let isValid = true;\n                \n                for(let j = 0; j < maxAmount + i; j += i) {\n                    if(inputArray.some(element => element === j)) {\n                        isValid = false;\n                    }\n                }\n                \n                if(isValid) return i;\n            }\n            \n            return null;\n        }",code:function(e){for(var t=Math.max.apply(Math,Object(f.a)(e)),n=2;n<e.length+n-1;n++){for(var r=!0,i=function(t){e.some((function(e){return e===t}))&&(r=!1)},a=0;a<t+n;a+=n)i(a);if(r)return n}return null},arguments:{descriptions:[{text:"Array of Integers (No Brackets [])",type:"NumberArray"}]}},beautifulText:{name:"beautifulText",instructions:"Consider a string containing only letters and whitespaces. It is allowed to replace some (possibly, none) whitespaces with newline symbols to obtain a multiline text. Call a multiline text beautiful if and only if each of its lines (i.e. substrings delimited by a newline character) contains an equal number of characters (only letters and whitespaces should be taken into account when counting the total while newline characters shouldn't). Call the length of the line the text width.\n\n        Given a string and some integers l and r (l \u2264 r), check if it's possible to obtain a beautiful text from the string with a text width that's within the range [l, r].",codeOutput:'function beautifulText(inputString, l, r) {\n            //Loop through all ranges within l -> r.\n            for(let i = l; i <= r; i++) {\n                //See if all of these indexes within this range of characters has a space at the end\n                //Keep track of the offset(number of times to skip over spaces) and the current index, based on the current length.\n                let offset = 0;\n                let currentIndex = i;\n                //Check if all indexes within this size range are spaces.\n                while(inputString[currentIndex + offset] === " ") {\n                    //Add this iteration to the offset\n                    offset++;\n                    //If we have reached the last possible space, make sure this splits the string into 3 strings of the same length.\n                    if(currentIndex + offset + i >= inputString.length - 1) {\n                        if((inputString.length - offset) / (offset + 1) === i) return true;\n                    }\n                    //Move on to next index within this range.\n                    currentIndex += i;\n                }\n            }\n            \n            return false;\n        }',code:function(e,t,n){for(var r=t;r<=n;r++)for(var i=0,a=r;" "===e[a+i];){if(a+ ++i+r>=e.length-1&&(e.length-i)/(i+1)===r)return!0;a+=r}return!1},arguments:{descriptions:[{text:"String of Text (Letters and Whitespace; Quotes Not Needed)",type:"String"},{text:"Positive Integer (Left Range)",type:"Number"},{text:"Positive Integer (Right Range)",type:"Number"}]}},bishopAndPawn:{name:"bishopAndPawn",instructions:"Given the positions of a white bishop and a black pawn on the standard chess board, determine whether the bishop can capture the pawn in one move.\n\n        The bishop has no restrictions in distance for each move, but is limited to diagonal movement. Check out the example below to see how it can move:",codeOutput:'function bishopAndPawn(bishop, pawn) {\n            let currentSquare = bishop;\n            let currentLetter = currentSquare[0];\n            let currentNumber = Number(currentSquare[1]);\n            \n            //Check up-right\n            while(currentLetter < "h" && currentNumber < 8) {\n                currentLetter = String.fromCharCode(currentLetter.charCodeAt(0) + 1);\n                currentNumber++;\n                currentSquare = currentLetter + currentNumber;\n                if(currentSquare === pawn) return true;\n            }\n            \n            currentSquare = bishop;\n            currentLetter = currentSquare[0];\n            currentNumber = Number(currentSquare[1]);\n            \n            //Check down-right\n            while(currentLetter < "h" && currentNumber > 1) {\n                currentLetter = String.fromCharCode(currentLetter.charCodeAt(0) + 1);\n                currentNumber--;\n                currentSquare = currentLetter + currentNumber;\n                if(currentSquare === pawn) return true;\n            }\n            \n            currentSquare = bishop;\n            currentLetter = currentSquare[0];\n            currentNumber = Number(currentSquare[1]);\n            \n            //Check down-left\n            while(currentLetter > "a" && currentNumber > 1) {\n                currentLetter = String.fromCharCode(currentLetter.charCodeAt(0) - 1);\n                currentNumber--;\n                currentSquare = currentLetter + currentNumber;\n                if(currentSquare === pawn) return true;\n            }\n            \n            currentSquare = bishop;\n            currentLetter = currentSquare[0];\n            currentNumber = Number(currentSquare[1]);\n            \n            //Check up-left\n            while(currentLetter > "a" && currentNumber < 8) {\n                currentLetter = String.fromCharCode(currentLetter.charCodeAt(0) - 1);\n                currentNumber++;\n                currentSquare = currentLetter + currentNumber;\n                if(currentSquare === pawn) return true;\n            }\n            \n            return false;\n        }',code:function(e,t){for(var n=e,r=n[0],i=Number(n[1]);r<"h"&&i<8;)if((n=(r=String.fromCharCode(r.charCodeAt(0)+1))+ ++i)===t)return!0;for(r=(n=e)[0],i=Number(n[1]);r<"h"&&i>1;)if((n=(r=String.fromCharCode(r.charCodeAt(0)+1))+--i)===t)return!0;for(r=(n=e)[0],i=Number(n[1]);r>"a"&&i>1;)if((n=(r=String.fromCharCode(r.charCodeAt(0)-1))+--i)===t)return!0;for(r=(n=e)[0],i=Number(n[1]);r>"a"&&i<8;)if((n=(r=String.fromCharCode(r.charCodeAt(0)-1))+ ++i)===t)return!0;return!1},arguments:{descriptions:[{text:"Bishop Location (In Form Of [a-h][1-8])",type:"String"},{text:"Pawn Location (In Form Of [a-h][1-8])",type:"String"}]}},bishopDiagonal:{name:"bishopDiagonal",instructions:"In the Land Of Chess, bishops don't really like each other. In fact, when two bishops happen to stand on the same diagonal, they immediately rush towards the opposite ends of that same diagonal.\n\n        Given the initial positions (in chess notation) of two bishops, bishop1 and bishop2, calculate their future positions. Keep in mind that bishops won't move unless they see each other along the same diagonal.",codeOutput:'function bishopDiagonal(bishop1, bishop2) {\n            //See if bishops lie on different diagonals. If so, return initial values.\n            if(!(Math.abs(bishop1.charCodeAt(0) - bishop2.charCodeAt(0)) === Math.abs(bishop1.charCodeAt(1) - bishop2.charCodeAt(1)))) return [bishop1, bishop2].sort();\n            \n            //Otherwise, find which directions each bishop will travel.\n        \n            //Helper function to move Bishops\n            const moveBishops = (bishopInput, letter, number) => {\n                //Taking the bishop\'s starting location, continue to move in the correct diagonal direction until it reaches bounds.\n                let bishop = bishopInput;\n                while((bishop[0] > "a" && bishop[0]) < "h" &&\n                (bishop[1] > 1 && bishop[1] < 8)) {\n                    console.log("In a loop")\n                    //Update letter\n                    bishop = letter === "add" ? \n                    String.fromCharCode(bishop.charCodeAt(0) + 1) + bishop[1] :\n                    String.fromCharCode(bishop.charCodeAt(0) - 1) + bishop[1];\n                    \n                    //Update number\n                    bishop = number === "add" ? \n                    bishop[0] + String(Number(bishop[1]) + 1) :\n                    bishop[0] + String(Number(bishop[1]) - 1);\n                }\n                //Return the updated position.\n                return bishop;\n            };\n            \n            //Move Bishop 1\n            let currentBishop1 = moveBishops(\n                bishop1, \n                bishop1[0] > bishop2[0] ? "add" : "subtract",\n                bishop1[1] > bishop2[1] ? "add" : "subtract"\n            );\n            \n            //Move Bishop 2\n            let currentBishop2 = moveBishops(\n                bishop2, \n                bishop2[0] > bishop1[0] ? "add" : "subtract",\n                bishop2[1] > bishop1[1] ? "add" : "subtract"\n            );\n            \n            //Return final resting positions.\n            return [currentBishop1, currentBishop2].sort();\n        }',code:function(e,t){if(Math.abs(e.charCodeAt(0)-t.charCodeAt(0))!==Math.abs(e.charCodeAt(1)-t.charCodeAt(1)))return[e,t].sort();var n=function(e,t,n){for(var r=e;(r[0]>"a"&&r[0])<"h"&&r[1]>1&&r[1]<8;)console.log("In a loop"),r="add"===t?String.fromCharCode(r.charCodeAt(0)+1)+r[1]:String.fromCharCode(r.charCodeAt(0)-1)+r[1],r="add"===n?r[0]+String(Number(r[1])+1):r[0]+String(Number(r[1])-1);return r};return[n(e,e[0]>t[0]?"add":"subtract",e[1]>t[1]?"add":"subtract"),n(t,t[0]>e[0]?"add":"subtract",t[1]>e[1]?"add":"subtract")].sort()},arguments:{descriptions:[{text:"First Bishop Location (In Form Of [a-h][1-8])",type:"String"},{text:"Second Bishop Location (In Form Of [a-h][1-8])",type:"String"}]}},boxBlur:{name:"boxBlur",instructions:"Last night you partied a little too hard. Now there's a black and white photo of you that's about to go viral! You can't let this ruin your reputation, so you want to apply the box blur algorithm to the photo to hide its content.\n\n        The pixels in the input image are represented as integers. The algorithm distorts the input image in the following way: Every pixel x in the output image has a value equal to the average value of the pixel values from the 3 \xd7 3 square that has its center at x, including x itself. All the pixels on the border of x are then removed.\n        \n        Return the blurred image as an integer, with the fractions rounded down.",codeOutput:"function boxBlur(image) {\n            //Create output array\n            let output = [];\n            //Loop through all sets of 3 rows\n            for(let i = 0; i <= image.length - 3; i++) {\n                \n                //Create this 'row' of the output array.\n                let thisRow = [];\n                \n                //Loop through all sets of 3 cols\n                for(let j = 0; j <= image[i].length - 3; j++) {\n                    //Create the total of all 9 elements\n                    let total = 0;\n                    //Isolate the elements in this square and add them together  \n                    for(let i_prime = i; i_prime <= i + 2; i_prime++) {\n                        //Count the squares.\n                        for(let j_prime = j; j_prime <= j + 2; j_prime++) {\n                            total += image[i_prime][j_prime];\n                        }\n                    }\n                    //Push this row to the array.\n                    thisRow.push(Math.floor(total / 9));\n                }\n                \n                //Add this completed row to the output square.\n                output.push(thisRow);\n            }\n            //Return the completed output\n            return output;\n        }",code:function(e){for(var t=[],n=0;n<=e.length-3;n++){for(var r=[],i=0;i<=e[n].length-3;i++){for(var a=0,o=n;o<=n+2;o++)for(var s=i;s<=i+2;s++)a+=e[o][s];r.push(Math.floor(a/9))}t.push(r)}return t},arguments:{descriptions:[{text:"Array of Integer Arrays (0 - 255) - At Least 3 x 3 (Form of [1,2,3], [1,2,3]... * One Space Between Arrays)",type:"NumberArrayArray"}]}},boxesPacking:{name:"boxesPacking",instructions:"You are given n rectangular boxes, the ith box has the length lengthi, the width widthi and the height heighti. Your task is to check if it is possible to pack all boxes into one so that inside each box there is no more than one another box (which, in turn, can contain at most one another box, and so on). More formally, your task is to check whether there is such sequence of n different numbers pi (1 \u2264 pi \u2264 n) that for each 1 \u2264 i < n the box number pi can be put into the box number pi+1.\n        A box can be put into another box if all sides of the first one are less than the respective ones of the second one. You can rotate each box as you wish, i.e. you can swap its length, width and height if necessary.",codeOutput:'function boxesPacking(length, width, height) {\n            //Get all boxes with their dimensions.\n            let boxes = [];\n            for(let i = 0; i < arguments[0].length; i++) {\n                //Get all boxes with their dimensions.\n                let box = {\n                    dimensions: [length[i], width[i], height[i]].sort((a, b) => a - b),\n                    sum: length[i] + width[i] + height[i]\n                }\n                boxes.push(box);\n            }\n            \n            //Sort by sums so that the overall box sizes are ordered.\n            boxes.sort((a, b) => (a.sum > b.sum) ? 1 : -1);\n            \n            //Verify that for every box, the box that came before has dimensions that are all smaller.\n            for(let i = 1; i < boxes.length; i++) {\n                //Go through each sorted dimension.\n                for(let j = 0; j < arguments.length; j++) {\n                    //If we find equal or greater values in the previous box\'s dimensions, return false.\n                    if(!(boxes[i]["dimensions"][j] > boxes[i - 1]["dimensions"][j])) return false;\n                }\n            }\n            \n            return true;\n        }',code:function(e,t,n){for(var r=[],i=0;i<arguments[0].length;i++){var a={dimensions:[e[i],t[i],n[i]].sort((function(e,t){return e-t})),sum:e[i]+t[i]+n[i]};r.push(a)}r.sort((function(e,t){return e.sum>t.sum?1:-1}));for(var o=1;o<r.length;o++)for(var s=0;s<arguments.length;s++)if(!(r[o].dimensions[s]>r[o-1].dimensions[s]))return!1;return!0},arguments:{descriptions:[{text:"Length: Array of Positive Integers (No Brackets [])",type:"NumberArray"},{text:"Width: Array of Positive Integers (No Brackets []) - Same Array Length",type:"NumberArray"},{text:"Height: Array of Positive Integers (No Brackets []) - Same Array Length",type:"NumberArray"}]}},buildPalindrome:{name:"buildPalindrome",instructions:"Given a string, find the shortest possible string which can be achieved by adding characters to the end of initial string to make it a palindrome.",codeOutput:'function buildPalindrome(st) {\n            //Helper function to check palindrome\n            const checkPalindrome = checkString => {\n                //Create an array out of the first and second halves of the string to check, depending on whether it has odd or even number of characters.\n                let firstHalf = checkString.length % 2 === 0 ? \n                                checkString.substring(0, Math.floor(checkString.length / 2)).split("") :\n                                checkString.substring(0, Math.floor(checkString.length / 2) + 1).split("");\n                let secondHalf = checkString.substring(Math.floor(checkString.length / 2)).split("");\n                \n                //See if these two halves are the same. If we encounter different characters, it is not yet a palindrome.\n                while(firstHalf.length && secondHalf.length) {\n                    if(firstHalf.pop() !== secondHalf.shift()) return false;\n                }\n                \n                if(firstHalf.length || firstHalf.length) return false;\n                \n                return true;  \n            };\n            \n            //Keep track of the current word we want to be a palindrome as well as offsets for the beginning and end of the string.\n            \n            let palindrome = st;\n            let startOffset = 0;\n            let endOffset = 0;\n            \n            //Check if this is already a palindrome.\n            //If it is not, start the iterative process of removing the next character (based on start offset) and adding it to its corresponding location at the end of the string(based on the end offset).\n            //At the end of each iteration, update the palindrome word and offsets, and check if it is a palindrome yet.\n            while(!checkPalindrome(palindrome)) {\n                let firstHalf = palindrome.substring(0, palindrome.length - endOffset);\n                let secondHalf = palindrome[palindrome.length - endOffset] ? palindrome.substring(palindrome.length - endOffset) : "";\n                \n                let currentCharacter = palindrome[startOffset];\n                \n                palindrome = firstHalf + currentCharacter + secondHalf;\n                startOffset++;\n                endOffset++;\n            }\n            \n            return palindrome;\n        }\n        ',code:function(e){for(var t=function(e){for(var t=e.length%2===0?e.substring(0,Math.floor(e.length/2)).split(""):e.substring(0,Math.floor(e.length/2)+1).split(""),n=e.substring(Math.floor(e.length/2)).split("");t.length&&n.length;)if(t.pop()!==n.shift())return!1;return!t.length&&!t.length},n=e,r=0,i=0;!t(n);){var a=n.substring(0,n.length-i),o=n[n.length-i]?n.substring(n.length-i):"";n=a+n[r]+o,r++,i++}return n},arguments:{descriptions:[{text:"Input String",type:"String"}]}},calPoints:{name:"calPoints",instructions:'You are keeping score for a baseball game with strange rules. The game consists of several rounds, where the scores of past rounds may affect future rounds\' scores.\n\n        At the beginning of the game, you start with an empty record. You are given a list of strings ops, where ops[i] is the ith operation you must apply to the record and is one of the following:\n        \n        An integer x - Record a new score of x.\n        "+" - Record a new score that is the sum of the previous two scores. It is guaranteed there will always be two previous scores.\n        "D" - Record a new score that is double the previous score. It is guaranteed there will always be a previous score.\n        "C" - Invalidate the previous score, removing it from the record. It is guaranteed there will always be a previous score.\n        Return the sum of all the scores on the record.',codeOutput:'var calPoints = function(ops) {\n            let record = [];\n            \n            ops.forEach(op => {\n                if(parseInt(op)) {\n                    //If this is a number, add new score to record in number form.\n                    record.push(parseInt(op));\n                } else if(op === "C") {\n                    //If this is a C, clear the previous score.\n                    record.pop();\n                } else if(op === "D") {\n                    //If this is a D, double the last score and add it.\n                    record.push(parseInt(record[record.length - 1] * 2));\n                } else if(op === "+") {\n                    //If this is a +, combine the last two scores.\n                    record.push(parseInt(record[record.length - 1] + record[record.length - 2]));\n                }\n            });\n            \n            //Add up the records.    \n            return record.reduce((a, b) => a += b, 0);\n        };',code:function(e){var t=[];return e.forEach((function(e){parseInt(e)?t.push(parseInt(e)):"C"===e?t.pop():"D"===e?t.push(parseInt(2*t[t.length-1])):"+"===e&&t.push(parseInt(t[t.length-1]+t[t.length-2]))})),t.reduce((function(e,t){return e+t}),0)},arguments:{descriptions:[{text:"Array in format according to instructions (e.g. 5,2,C,D,+)",type:"StringArray"}]}},canConstruct:{name:"canConstruct",instructions:"Given two stings ransomNote and magazine, return true if ransomNote can be constructed from magazine and false otherwise.\n\n        Each letter in magazine can only be used once in ransomNote.",codeOutput:'var canConstruct = function(ransomNote, magazine) {\n            //Create a character map of each character in magazine to pull characters from.\n            let magazineMap = {};\n            //Convert to string, then create character map.\n            magazine.split("").forEach(letter => {\n                if(magazineMap[letter]) {\n                    magazineMap[letter]++;\n                } else {\n                    magazineMap[letter] = 1;\n                }\n            });\n            \n            //Create array to iteratively pull characters from.\n            let noteArray = ransomNote.split("");\n            //Until the end of the array is reached, see if this letter can be pulled from the magazine map.\n            while(noteArray.length) {\n                let thisLetter = noteArray.pop();\n                if(magazineMap[thisLetter]) {\n                    magazineMap[thisLetter]--;\n                } else {\n                    return false;\n                }\n            }\n            \n            //If we have reached the end of the noteArray, we know magazine can be used to create the note.\n            return true;\n        };',code:function(e,t){var n={};t.split("").forEach((function(e){n[e]?n[e]++:n[e]=1}));for(var r=e.split("");r.length;){var i=r.pop();if(!n[i])return!1;n[i]--}return!0},arguments:{descriptions:[{text:"String to represent the ransom note.",type:"String"},{text:"String to represent the magazine text.",type:"String"}]}},candles:{name:"candles",instructions:"When a candle finishes burning it leaves a leftover. makeNew leftovers can be combined to make a new candle, which, when burning down, will in turn leave another leftover.\n\n        You have candlesNumber candles in your possession. What's the total number of candles you can burn, assuming that you create new candles as soon as you have enough leftovers?",codeOutput:"function candles(candlesNumber, makeNew) {\n            //Start with current number of candles.\n            let currentCandles = candlesNumber;\n            let currentLeftovers = 0;\n            let totalBurned = 0;\n            \n            //Loop as long as there are whole candles to burn.\n            while(currentCandles > 0) {\n                //First, burn these candles.\n                totalBurned += currentCandles;\n                \n                //Next, make these current candles into leftovers.\n                currentLeftovers += currentCandles;\n                currentCandles -= currentCandles;\n                \n                //Finally, group the new candles using as many of the leftovers as possible.\n                currentCandles += Math.floor(currentLeftovers / makeNew);\n                currentLeftovers -= currentCandles * makeNew;\n            }\n            \n            return totalBurned;\n        }",code:function(e,t){for(var n=e,r=0,i=0;n>0;)i+=n,r+=n,n-=n,r-=(n+=Math.floor(r/t))*t;return i},arguments:{descriptions:[{text:"Number of Candles (Positive Integer)",type:"Number"},{text:"Number of Leftovers Used For New Candle (Positive Integer)",type:"Number"}]}},canWinNim:{name:"canWinNim",instructions:"You are playing the following Nim Game with your friend:\n\n        Initially, there is a heap of stones on the table.\n        You and your friend will alternate taking turns, and you go first.\n        On each turn, the person whose turn it is will remove 1 to 3 stones from the heap.\n        The one who removes the last stone is the winner.\n        Given n, the number of stones in the heap, return true if you can win the game assuming both you and your friend play optimally, otherwise return false.",codeOutput:"var canWinNim = function(n) {\n            //Since the loser will have a disadvantage any time the number of stones is a multiple of 4, return false for all those values.\n            if(n % 4 === 0) return false;\n            return true;\n        }",code:function(e){return e%4!==0},arguments:{descriptions:[{text:"Integer to Represent Number of Stones",type:"Number"}]}},characterParity:{name:"characterParity",instructions:"Given a character, check if it represents an odd digit, an even digit or not a digit at all.",codeOutput:'function characterParity(symbol) {\n            return symbol % 2 ? "odd" : isNaN(symbol % 2) ? "not a digit" : "even";\n        }',code:function(e){return e%2?"odd":isNaN(e%2)?"not a digit":"even"},arguments:{descriptions:[{text:"Single Character Symbol (UTF-8)",type:"String"}]}},checkPalindrome:{name:"checkPalindrome",instructions:"Given a string, check if it is a palindrome",codeOutput:'function checkPalindrome(inputString) {\n            return inputString.split("").reverse().join("") === inputString;\n        }',code:function(e){return e.split("").reverse().join("")===e},arguments:{descriptions:[{text:"String to Check",type:"String"}]}},checkPerfectNumber:{name:"checkPerfectNumber",instructions:"A perfect number is a positive integer that is equal to the sum of its positive divisors, excluding the number itself. A divisor of an integer x is an integer that can divide x evenly.\n\n        Given an integer n, return true if n is a perfect number, otherwise return false.",codeOutput:"var checkPerfectNumber = function(num) {\n            let factors = [];\n            \n            //Get all factors of the number (except for number itself)\n            let max = num;\n            let i = 1;\n            do {\n                //See if this is a factor.\n                if(num % i === 0) {\n                    //Make sure longer side is first in set.\n                    if(num / i !== num) {\n                        factors.push(num / i);\n                    }\n                    if(i !== num) {\n                        factors.push(i);\n                    }\n                }\n                //Update max and i.\n                max = Math.ceil(num / i);\n                i++;\n            } while(i < max);\n                \n            console.log(factors);\n            \n            //Return true if the factors add to the number.\n            return num === factors.reduce((a, b) => a += b, 0);  \n        };",code:function(e){var t=[],n=e,r=1;do{e%r===0&&(e/r!==e&&t.push(e/r),r!==e&&t.push(r)),n=Math.ceil(e/r),r++}while(r<n);return console.log(t),e===t.reduce((function(e,t){return e+t}),0)},arguments:{descriptions:[{text:"Whole Number Integer",type:"Number"}]}},chessBishopDream:{name:"chessBishopDream",instructions:"In ChessLand there is a small but proud chess bishop with a recurring dream. In the dream the bishop finds itself on an n \xd7 m chessboard with mirrors along each edge, and it is not a bishop but a ray of light. This ray of light moves only along diagonals (the bishop can't imagine any other types of moves even in its dreams), it never stops, and once it reaches an edge or a corner of the chessboard it reflects from it and moves on.\n\n        Given the initial position and the direction of the ray, find its position after k steps where a step means either moving from one cell to the neighboring one or reflecting from a corner of the board.",codeOutput:"function chessBishopDream(boardSize, initPosition, initDirection, k) {\n            //Keep track of count.\n            let count = 0;\n            //Monitor the current directions and positions.\n            let directions = [...initDirection];\n            let positions = [...initPosition];\n            //Helper function to perform move on either dimension.\n            const movePosition = position => {        \n                //Make sure this dimension can be moved upward/downward.\n                if(directions[position] === 1) {\n                    //Check if moving this upward is within bounds.\n                    if(positions[position] + directions[position] <= boardSize[position] - 1) {\n                        positions[position] += directions[position];\n                    } else {\n                        //Flip the direction of this dimension\n                        directions[position] *= -1;\n                    }\n                } else {\n                    //Check if moving this downward is within bounds.\n                    if(positions[position] + directions[position] >= 0) {\n                        positions[position] += directions[position];\n                    } else {\n                        //Flip the direction of this dimension\n                        directions[position] *= -1;\n                    }    \n                }\n            };\n            \n            //Loop to perform moves.\n            while(count < k) {\n                //Perform move on each dimension.\n                movePosition(0);\n                movePosition(1);\n                //update iteration count.\n                count++;\n                //Once the positions and directions are again the same as how they started:\n                if(positions[0] === initPosition[0] && positions[1] === initPosition[1] &&\n                directions[0] === initDirection[0] && directions[1] === initDirection[1]) {\n                    //In order to prevent too many iterations, once the original positions and directions are arrived at again, only go as many more iterations as needed to reach the desired position.\n                    if(count > 0) k = count + (k % count);\n                }    \n            }\n            \n            //Return final positions.\n            return positions;\n        }",code:function(e,t,n,r){for(var i=0,a=Object(f.a)(n),o=Object(f.a)(t),s=function(t){1===a[t]?o[t]+a[t]<=e[t]-1?o[t]+=a[t]:a[t]*=-1:o[t]+a[t]>=0?o[t]+=a[t]:a[t]*=-1};i<r;)s(0),s(1),i++,o[0]===t[0]&&o[1]===t[1]&&a[0]===n[0]&&a[1]===n[1]&&i>0&&(r=i+r%i);return o},arguments:{descriptions:[{text:"Board Size (Integer Array; No Brackets [])",type:"NumberArray"},{text:"Initial Position (Integer Array; No Brackets [])",type:"NumberArray"},{text:"Initial Direction (Integer Array of 1 or -1; No Brackets [])",type:"NumberArray"},{text:"Number of Steps",type:"Number"}]}},chessBoardCellColor:{name:"chessBoardCellColor",instructions:"Given two cells on the standard chess board, determine whether they have the same color or not.",codeOutput:"function chessBoardCellColor(cell1, cell2) {\n            let cell1Color;\n            let cell2Color;\n            if(cell1.charCodeAt(0) % 2 === cell1.charCodeAt(1) % 2) {\n                cell1Color = 'dark';\n            } else {\n                cell1Color = 'light';\n            }\n            if(cell2.charCodeAt(0) % 2 === cell2.charCodeAt(1) % 2) {\n                cell2Color = 'dark';\n            } else {\n                cell2Color = 'light';\n            }\n            return cell1Color === cell2Color;\n        }",code:function(e,t){return(e.charCodeAt(0)%2===e.charCodeAt(1)%2?"dark":"light")===(t.charCodeAt(0)%2===t.charCodeAt(1)%2?"dark":"light")},arguments:{descriptions:[{text:"Chess Board Position (In Form Of [a-h][1-8])",type:"String"},{text:"Chess Board Position (In Form Of [a-h][1-8])",type:"String"}]}},chessKnight:{name:"chessKnight",instructions:"Given a position of a knight on the standard chessboard, find the number of different moves the knight can perform.\n\n        The knight can move to a square that is two squares horizontally and one square vertically, or two squares vertically and one square horizontally away from it. The complete move therefore looks like the letter L. Check out the image below to see all valid moves for a knight piece that is placed on one of the central squares.",codeOutput:"function chessKnight(cell) {\n            //Create a character code representation of the letter cell.\n            let col = cell.charCodeAt(0);\n            let row = Number(cell[1]);\n            let totalSpaces = 0;\n            \n            if(col + 2 <= 104) {\n                //If we can go 2 spaces to the right, check the one up and one down.\n                if(row + 1 <= 8) totalSpaces++;\n                if(row - 1 >= 1) totalSpaces++;\n            }\n        \n            if(row + 2 <= 8) {\n                //If we can go 2 spaces up, check one left and one right.\n                if(col + 1 <= 104) totalSpaces++;\n                if(col - 1 >= 97) totalSpaces++;\n            }\n            \n            if(col - 2 >= 97) {\n                //If we can go 2 spaces to the left, check the one up and one down.\n                if(row + 1 <= 8) totalSpaces++;\n                if(row - 1 >= 1) totalSpaces++;\n            }\n            \n            if(row - 2 >= 1) {\n                //If we can go 2 spaces down, check one left and one right.\n                if(col + 1 <= 104) totalSpaces++;\n                if(col - 1 >= 97) totalSpaces++;\n            }\n            \n            return totalSpaces;\n        }",code:function(e){var t=e.charCodeAt(0),n=Number(e[1]),r=0;return t+2<=104&&(n+1<=8&&r++,n-1>=1&&r++),n+2<=8&&(t+1<=104&&r++,t-1>=97&&r++),t-2>=97&&(n+1<=8&&r++,n-1>=1&&r++),n-2>=1&&(t+1<=104&&r++,t-1>=97&&r++),r},arguments:{descriptions:[{text:"Chess Board Position (In Form Of [a-h][1-8])",type:"String"}]}},chessTriangle:{name:"chessTriangle",instructions:"Consider a bishop, a knight and a rook on an n \xd7 m chessboard. They are said to form a triangle if each piece attacks exactly one other piece and is attacked by exactly one piece. Calculate the number of ways to choose positions of the pieces to form a triangle.\n\n        Note that the bishop attacks pieces sharing the common diagonal with it; the rook attacks in horizontal and vertical directions; and, finally, the knight attacks squares which are two squares horizontally and one square vertically, or two squares vertically and one square horizontally away from its position.",codeOutput:"function chessTriangle(n, m) {\n            let count = 0;\n            //Loop through every square, where a knight could be.\n            for(let i = 0; i < n; i++) {\n                for(let j = 0; j < m; j++) {\n                    //At each square, find every spot where this knight could attack.\n                    \n                    //Check right side (1/4)\n                    \n                    //Check upper 4x3 rectangle (K is corner)\n                    if(i - 3 >= 0 && j + 2 < m) count++;\n                    //Check upper 3x3 rectangle (K is corner)\n                    if(i - 2 >= 0 && j + 2 < m) count++;\n                    //Check upper 2x3 rectangle (K is corner)\n                    if(i - 1 >= 0 && j + 2 < m) count += 2;\n                    //Check lower 4x3 rectangle (K is corner)\n                    if(i + 3 < n && j + 2 < m) count++;\n                    //Check lower 3x3 rectangle (K is corner)\n                    if(i + 2 < n && j + 2 < m) count++;\n                    //Check lower 2x3 rectangle (K is corner) \n                    if(i + 1 < n && j + 2 < m) count += 2;\n                    //Plus, check if K is middle of 3x3 rectangle\n                    if(i + 1 < n && i - 1 >= 0 && j + 2 < m) count += 2;\n                    //Check if K is lower end of a 4x3 rectangle\n                    if(i - 2 >= 0 && i + 1 < n && j + 2 < m) count++;\n                    //Check if K is higher end of a 4x3 rectangle\n                    if(i - 1 >= 0 && i + 2 < n && j + 2 < m) count++;\n                    //Check upper 2x4 rectangle (K is corner)\n                    if(i - 1 >= 0 && j + 3 < m) count+=2;\n                    //Check lower 2x4 rectangle (K is corner)\n                    if(i + 1 < n && j + 3 < m) count+=2;\n                    \n                    //Check left side (2/4)\n                    \n                    //Check upper 4x3 rectangle (K is corner)\n                    if(i - 3 >= 0 && j - 2 >= 0) count++;\n                    //Check upper 3x3 rectangle (K is corner)\n                    if(i - 2 >= 0 && j - 2 >= 0) count++;\n                    //Check upper 2x3 rectangle (K is corner)\n                    if(i - 1 >= 0 && j - 2 >= 0) count += 2;\n                    //Check lower 4x3 rectangle (K is corner)\n                    if(i + 3 < n && j - 2 >= 0) count++;\n                    //Check lower 3x3 rectangle (K is corner)\n                    if(i + 2 < n && j - 2 >= 0) count++;\n                    //Check lower 2x3 rectangle (K is corner) \n                    if(i + 1 < n && j - 2 >= 0) count += 2;\n                    //Plus, check if K is middle of 3x3 rectangle\n                    if(i + 1 < n && i - 1 >= 0 && j - 2 >= 0) count += 2;\n                    //Check if K is lower end of a 4x3 rectangle\n                    if(i - 2 >= 0 && i + 1 < n && j - 2 >= 0) count++;\n                    //Check if K is higher end of a 4x3 rectangle\n                    if(i - 1 >= 0 && i + 2 < n && j - 2 >= 0) count++;\n                    //Check upper 2x4 rectangle (K is corner)\n                    if(i - 1 >= 0 && j - 3 >= 0) count+=2;\n                    //Check lower 2x4 rectangle (K is corner)\n                    if(i + 1 < n && j - 3 >= 0) count+=2;\n                    \n                    //Check top side (3/4)\n                    \n                    //Check upper 4x3 rectangle (K is corner)\n                    if(j - 3 >= 0 && i - 2 >= 0) count++;\n                    //Check upper 3x3 rectangle (K is corner)\n                    if(j - 2 >= 0 && i - 2 >= 0) count++;\n                    //Check upper 2x3 rectangle (K is corner)\n                    if(j - 1 >= 0 && i - 2 >= 0) count += 2;\n                    //Check lower 4x3 rectangle (K is corner)\n                    if(j + 3 < m && i - 2 >= 0) count++;\n                    //Check lower 3x3 rectangle (K is corner)\n                    if(j + 2 < m && i - 2 >= 0) count++;\n                    //Check lower 2x3 rectangle (K is corner) \n                    if(j + 1 < m && i - 2 >= 0) count += 2;\n                    //Plus, check if K is middle of 3x3 rectangle\n                    if(j + 1 < m && j - 1 >= 0 && i - 2 >= 0) count += 2;\n                    //Check if K is lower end of a 4x3 rectangle\n                    if(j - 2 >= 0 && j + 1 < m && i - 2 >= 0) count++;\n                    //Check if K is higher end of a 4x3 rectangle\n                    if(j - 1 >= 0 && j + 2 < m && i - 2 >= 0) count++;\n                    //Check upper 2x4 rectangle (K is corner)\n                    if(j - 1 >= 0 && i - 3 >= 0) count+=2;\n                    //Check lower 2x4 rectangle (K is corner)\n                    if(j + 1 < m && i - 3 >= 0) count+=2;\n                    \n                    //Check bottom side (4/4)\n                    \n                    //Check upper 4x3 rectangle (K is corner)\n                    if(j - 3 >= 0 && i + 2 < n) count++;\n                    //Check upper 3x3 rectangle (K is corner)\n                    if(j - 2 >= 0 && i + 2 < n) count++;\n                    //Check upper 2x3 rectangle (K is corner)\n                    if(j - 1 >= 0 && i + 2 < n) count += 2;\n                    //Check lower 4x3 rectangle (K is corner)\n                    if(j + 3 < m && i + 2 < n) count++;\n                    //Check lower 3x3 rectangle (K is corner)\n                    if(j + 2 < m && i + 2 < n) count++;\n                    //Check lower 2x3 rectangle (K is corner) \n                    if(j + 1 < m && i + 2 < n) count += 2;\n                    //Plus, check if K is middle of 3x3 rectangle\n                    if(j + 1 < m && j - 1 >= 0 && i + 2 < n) count += 2;\n                    //Check if K is lower end of a 4x3 rectangle\n                    if(j - 2 >= 0 && j + 1 < m && i + 2 < n) count++;\n                    //Check if K is higher end of a 4x3 rectangle\n                    if(j - 1 >= 0 && j + 2 < m && i + 2 < n) count++;\n                    //Check upper 2x4 rectangle (K is corner)\n                    if(j - 1 >= 0 && i + 3 < n) count+=2;\n                    //Check lower 2x4 rectangle (K is corner)\n                    if(j + 1 < m && i + 3 < n) count+=2;\n                }\n            }\n            \n            return count;\n        }",code:function(e,t){for(var n=0,r=0;r<e;r++)for(var i=0;i<t;i++)r-3>=0&&i+2<t&&n++,r-2>=0&&i+2<t&&n++,r-1>=0&&i+2<t&&(n+=2),r+3<e&&i+2<t&&n++,r+2<e&&i+2<t&&n++,r+1<e&&i+2<t&&(n+=2),r+1<e&&r-1>=0&&i+2<t&&(n+=2),r-2>=0&&r+1<e&&i+2<t&&n++,r-1>=0&&r+2<e&&i+2<t&&n++,r-1>=0&&i+3<t&&(n+=2),r+1<e&&i+3<t&&(n+=2),r-3>=0&&i-2>=0&&n++,r-2>=0&&i-2>=0&&n++,r-1>=0&&i-2>=0&&(n+=2),r+3<e&&i-2>=0&&n++,r+2<e&&i-2>=0&&n++,r+1<e&&i-2>=0&&(n+=2),r+1<e&&r-1>=0&&i-2>=0&&(n+=2),r-2>=0&&r+1<e&&i-2>=0&&n++,r-1>=0&&r+2<e&&i-2>=0&&n++,r-1>=0&&i-3>=0&&(n+=2),r+1<e&&i-3>=0&&(n+=2),i-3>=0&&r-2>=0&&n++,i-2>=0&&r-2>=0&&n++,i-1>=0&&r-2>=0&&(n+=2),i+3<t&&r-2>=0&&n++,i+2<t&&r-2>=0&&n++,i+1<t&&r-2>=0&&(n+=2),i+1<t&&i-1>=0&&r-2>=0&&(n+=2),i-2>=0&&i+1<t&&r-2>=0&&n++,i-1>=0&&i+2<t&&r-2>=0&&n++,i-1>=0&&r-3>=0&&(n+=2),i+1<t&&r-3>=0&&(n+=2),i-3>=0&&r+2<e&&n++,i-2>=0&&r+2<e&&n++,i-1>=0&&r+2<e&&(n+=2),i+3<t&&r+2<e&&n++,i+2<t&&r+2<e&&n++,i+1<t&&r+2<e&&(n+=2),i+1<t&&i-1>=0&&r+2<e&&(n+=2),i-2>=0&&i+1<t&&r+2<e&&n++,i-1>=0&&i+2<t&&r+2<e&&n++,i-1>=0&&r+3<e&&(n+=2),i+1<t&&r+3<e&&(n+=2);return n},arguments:{descriptions:[{text:"Size of Dimension #1 (Positive Integer)",type:"Number"},{text:"Size of Dimension #2 (Positive Integer)",type:"Number"}]}},christmasTree:{name:"christmasTree",instructions:"It's Christmas time! To share his Christmas spirit with all his friends, the young Christmas Elf decided to send each of them a Christmas e-mail with a nice Christmas tree. Unfortunately, Internet traffic is very expensive in the North Pole, so instead of sending an actual image he got creative and drew the tree using nothing but asterisks ('*' symbols). He has given you the specs (see below) and your task is to write a program that will generate trees following the spec and some initial parameters.\n\n        Here is a formal definition of how the tree should be built, but before you read it the Elf HIGHLY recommends first looking at the examples that follow:\n        \n        Each tree has a crown as follows:\n        \n         *\n         *\n        ***\n        Define a line as a horizontal group of asterisks and a level as a collection of levelHeight lines stacked one on top of the other.\n        \n        Below the crown there are levelNum levels.\n        \n        The tree is perfectly symmetrical so all the middle asterisks of the lines lie on the center of the tree.\n        \n        Each line of the same level (excluding the first one) has two more asterisks than the previous one (one added to each end);\n        \n        The number of asterisks in the first line of each level is chosen as follows:\n        \n        the first line of the first level has 5 asterisks;\n        the first line of each consecutive level contains two more asterisks than the first line of the previous level.\n        And finally there is the tree foot which has a height of levelNum and a width of:\n        \n        levelHeight asterisks if levelHeight is odd;\n        levelHeight + 1 asterisks if levelHeight is even.\n        Given levelNum and levelHeight, return the Christmas tree of the young elf.",codeOutput:'function christmasTree(levelNum, levelHeight) {\n            let tree = [];\n            let maxLength = 5 + (2 * (levelHeight - 1)) + (2 * (levelNum - 1));\n            //Create crown\n            let crownTop = "";\n            for(let i = 0; i <= (maxLength - 1) / 2; i++) {\n                crownTop += i === (maxLength - 1) / 2 ? "*" : " ";\n            }\n            tree.push(crownTop);\n            tree.push(crownTop);\n            let crownBase = "";\n            for(let i = 0; i <= ((maxLength - 1) / 2) + 1; i++) {\n                crownBase += i < (((maxLength - 1) / 2) + 1) - 2 ? " " : "*";\n            }   \n            tree.push(crownBase);\n            \n            //Create Main Levels\n            for(let thisLevel = 0; thisLevel < levelNum; thisLevel++) {\n                //Establish the size (number of *) of the first(top) line\n                let defaultTopSize = 5 + (thisLevel * 2);\n                //Establish the length (number of total indexes) of the first(top) line\n                let defaultTopLength = ((maxLength - 1) / 2) + 3 + (thisLevel * 1);\n                \n                //For each level, construct each line\n                for(let thisLine = 0; thisLine < levelHeight; thisLine++) {\n                    //Establish the size(number of *) of the current line\n                    let line = "";\n                    let thisSize = defaultTopSize + (2 * thisLine);\n                    let thisLength = defaultTopLength + (1 * thisLine);\n                                \n                    //Fill in this line\n                    for(let i = 0; i < thisLength; i++) {\n                        let thisChar = i < thisLength - thisSize ? " " : "*";\n                        line += thisChar;\n                    }\n                        \n                    //Push this line into the tree.        \n                    tree.push(line);\n                }\n            }\n            \n            //Construct base\n            let baseWidth = levelHeight % 2 ? levelHeight : levelHeight + 1;\n            let baseLength = maxLength - ((maxLength - baseWidth) / 2);\n            let base = "";\n                \n            //Fill in the characters for the base\n            for(let i = 0; i < baseLength; i++) {\n                base += i < baseLength - baseWidth ? " " : "*";\n            }\n            \n            //Using the line for the base, fill into the tree the correct number of times.\n            for(let baseLevel = 0; baseLevel < levelNum; baseLevel++) {\n                tree.push(base);\n            }\n            \n            return tree;\n        }',code:function(e,t){for(var n=[],r=5+2*(t-1)+2*(e-1),i="",a=0;a<=(r-1)/2;a++)i+=a===(r-1)/2?"*":" ";n.push(i),n.push(i);for(var o="",s=0;s<=(r-1)/2+1;s++)o+=s<(r-1)/2+1-2?" ":"*";n.push(o);for(var u=0;u<e;u++)for(var l=5+2*u,c=(r-1)/2+3+1*u,h=0;h<t;h++){for(var d="",f=l+2*h,m=c+1*h,g=0;g<m;g++){d+=g<m-f?" ":"*"}n.push(d)}for(var p=t%2?t:t+1,b=r-(r-p)/2,y="",w=0;w<b;w++)y+=w<b-p?" ":"*";for(var v=0;v<e;v++)n.push(y);return n},arguments:{descriptions:[{text:"Integer to Represent Number of Levels",type:"Number"},{text:"Integer to Represent Height of Levels",type:"Number"}]}},cipher26:{name:"cipher26",instructions:"You've intercepted an encrypted message, and you are really curious about its contents. You were able to find out that the message initially contained only lowercase English letters, and was encrypted with the following cipher:\n\n        Let all letters from 'a' to 'z' correspond to the numbers from 0 to 25, respectively.\n        The number corresponding to the ith letter of the encrypted message is then equal to the sum of numbers corresponding to the first i letters of the initial unencrypted message modulo 26.\n        Now that you know how the message was encrypted, implement the algorithm to decipher it.",codeOutput:"function cipher26(message) {\n            let runningSum = message.charCodeAt(0) - 97;\n            let decodedMessage = message[0];\n            \n            for(let i = 1; i < message.length; i++) {\n                let currentCode = message.charCodeAt(i) - 97; \n                //Based on the current code, find what value of the decoded code would yield this current code when added to the running total modulo 26.\n                let decodedCode = 0;\n                while((runningSum + decodedCode) % 26 !== currentCode) {\n                    decodedCode++;\n                }\n                //Update Values\n                runningSum += decodedCode;\n                decodedMessage += String.fromCharCode(decodedCode + 97);\n            }\n            \n            return decodedMessage;\n        }\n        ",code:function(e){for(var t=e.charCodeAt(0)-97,n=e[0],r=1;r<e.length;r++){for(var i=e.charCodeAt(r)-97,a=0;(t+a)%26!==i;)a++;t+=a,n+=String.fromCharCode(a+97)}return n},arguments:{descriptions:[{text:"Message to Cipher (Lowercase Word)",type:"String"}]}},circleOfNumbers:{name:"circleOfNumbers",instructions:"Consider integer numbers from 0 to n - 1 written down along the circle in such a way that the distance between any two neighboring numbers is equal (note that 0 and n - 1 are neighboring, too).\n\n        Given n and firstNumber, find the number which is written in the radially opposite position to firstNumber.",codeOutput:"function circleOfNumbers(n, firstNumber) {\n            return firstNumber < n / 2 ? n / 2 + firstNumber : Math.abs(n / 2 - firstNumber);\n        }",code:function(e,t){return t<e/2?e/2+t:Math.abs(e/2-t)},arguments:{descriptions:[{text:"Integer (Represent Number of Numbers)",type:"Number"},{text:"Integer (Represent First Number)",type:"Number"}]}},climbStairs:{name:"climbStairs",instructions:"You are climbing a staircase. It takes n steps to reach the top.\n\n        Each time you can either climb 1 or 2 steps. In how many distinct ways can you climb to the top?",codeOutput:"var climbStairs = function(n) {\n            //Since this pattern essentially can be simplified to the fibonacci sequence, start with 0 and 1. \n            let num1 = 0;\n            let num2 = 1;\n            //Until we reach the destination n, repeatedly add the last two elements.\n            for(let i = 1; i < n; i++) {\n                let nextNum = num1 + num2;\n                num1 = num2;\n                num2 = nextNum;\n            }\n            //Finally, return the last 2 elements. This will be the number of combinations of 1 and 2 steps.\n            return num1 + num2;\n        };",code:function(e){for(var t=0,n=1,r=1;r<e;r++){var i=t+n;t=n,n=i}return t+n},arguments:{descriptions:[{text:"Number of Stairs",type:"Number"}]}},combs:{name:"combs",instructions:"Miss X has only two combs in her possession, both of which are old and miss a tooth or two. She also has many purses of different length, in which she carries the combs. The only way they fit is horizontally and without overlapping. Given teeth' positions on both combs, find the minimum length of the purse she needs to take them with her.\n\n        It is guaranteed that there is at least one tooth at each end of the comb.\n        It is also guaranteed that the total length of two strings is smaller than 32.\n        Note, that the combs can not be rotated/reversed.",codeOutput:'function combs(comb1, comb2) {\n            //Keep track of array versions of both combs.\n            let comb1Copy = comb1.split("");\n            let comb2Copy = comb2.split("");\n            //Keep track of the total number of space maintained by both versions of a shift.\n            let leftSplit = 0;\n            let rightSplit = 0;\n            //Keep track of the number of spaces removed.\n            let offset = 0;\n            //Shift comb1 to the left (Add remaining length of comb1 to offset)\n            while(comb1Copy.length && leftSplit === 0) {\n                comb1Copy.shift();\n                offset++;\n                //Check all places to see if this is a valid \'combination\'\n                let valid = true;\n                for(let i = 0; i < Math.min(comb1Copy.length, comb2Copy.length); i++) {\n                    if(comb1Copy[i] === "*" && comb2Copy[i] === "*") {\n                        valid = false;\n                    }\n                }\n                if(valid) leftSplit = Math.max(comb1Copy.length, comb2Copy.length) + offset;\n                \n            }\n            //Reset values to do other split.\n            comb1Copy = comb1.split("");\n            comb2Copy = comb2.split("");\n            offset = 0;\n            //Shift comb2 to the left (Add remaining length of comb1 to offset) and repeat process.\n            while(comb2Copy.length && !rightSplit) {\n                comb2Copy.shift();\n                offset++;\n                //Check all places\n                let valid = true;\n                for(let i = 0; i < Math.min(comb2Copy.length, comb1.length); i++) {\n                    if(comb2Copy[i] === "*" && comb1[i] === "*") {\n                        valid = false;\n                    }\n                }\n                if(valid) rightSplit = comb1.length + offset;\n            }\n            //Return the version of the shift that takes up the least space.\n            return Math.min(leftSplit, rightSplit);\n        }',code:function(e,t){for(var n=e.split(""),r=t.split(""),i=0,a=0,o=0;n.length&&0===i;){n.shift(),o++;for(var s=!0,u=0;u<Math.min(n.length,r.length);u++)"*"===n[u]&&"*"===r[u]&&(s=!1);s&&(i=Math.max(n.length,r.length)+o)}for(n=e.split(""),r=t.split(""),o=0;r.length&&!a;){r.shift(),o++;for(var l=!0,c=0;c<Math.min(r.length,e.length);c++)"*"===r[c]&&"*"===e[c]&&(l=!1);l&&(a=e.length+o)}return Math.min(i,a)},arguments:{descriptions:[{text:"String Representing a Comb (Only * and .)",type:"String"},{text:"String Representing a Comb (Only * and .)",type:"String"}]}},comfortableNumbers:{name:"comfortableNumbers",instructions:"Let's say that number a feels comfortable with number b if a \u2260 b and b lies in the segment [a - s(a), a + s(a)], where s(x) is the sum of x's digits.\n\n        How many pairs (a, b) are there, such that a < b, both a and b lie on the segment [l, r], and each number feels comfortable with the other (so a feels comfortable with b and b feels comfortable with a)?",codeOutput:'function comfortableNumbers(l, r) {\n            //Get starting pairs for a and b.\n            let a = l;\n            let b = a + 1;\n            //Keep track of comfortable pairs.\n            let count = 0;\n            while(a < r && b <= r) {\n                //Get the comfortable range for a.\n                let aMin = a - String(a).split("").reduce((total, current) => {\n                    return total += Number(current);\n                }, 0);\n                let aMax = a + String(a).split("").reduce((total, current) => {\n                    return total += Number(current);\n                }, 0);\n                //Get the comfortable range for b.\n                let bMin = b - String(b).split("").reduce((total, current) => {\n                    return total += Number(current);\n                }, 0);\n                let bMax = b + String(b).split("").reduce((total, current) => {\n                    return total += Number(current);\n                }, 0);\n                //If b is with the comfortable range (and a is comfortable with the b range), add to the count.\n                if(b >= aMin && b <= aMax && a !== b\n                && a >= bMin && a <= bMax && a !== b) count++;\n                //Move onto next pair.\n                if(b < r) {\n                    b++;\n                } else {\n                    a++;\n                    b = a + 1;\n                }\n            }\n            return count;\n        }',code:function(e,t){for(var n=e,r=n+1,i=0;n<t&&r<=t;){var a=n-String(n).split("").reduce((function(e,t){return e+Number(t)}),0),o=n+String(n).split("").reduce((function(e,t){return e+Number(t)}),0),s=r-String(r).split("").reduce((function(e,t){return e+Number(t)}),0),u=r+String(r).split("").reduce((function(e,t){return e+Number(t)}),0);r>=a&&r<=o&&n!==r&&n>=s&&n<=u&&n!==r&&i++,r<t?r++:r=++n+1}return i},arguments:{descriptions:[{text:"Left Integer",type:"Number"},{text:"Right Integer",type:"Number"}]}},commonCharacterCount:{name:"commonCharacterCount",instructions:"Given two strings, find the number of common characters between them.",codeOutput:"function commonCharacterCount(s1, s2) {\n            let numMatching = 0;\n            let charMap1 = {};\n            let charMap2 = {};\n            \n            for(let i = 0; i < s1.length; i++) {\n                if(charMap1[s1[i]]) {\n                    charMap1[s1[i]]++;\n                } else {\n                    charMap1[s1[i]] = 1;\n                }\n            } \n            \n            for(let i = 0; i < s2.length; i++) {\n                if(charMap2[s2[i]]) {\n                    charMap2[s2[i]]++;\n                } else {\n                    charMap2[s2[i]] = 1;\n                }\n            } \n            \n            console.log(charMap1);\n            console.log(charMap2);\n            \n            for(let char in charMap1) {\n                while(charMap1[char]) {\n                    if(charMap2[char]) {\n                        charMap2[char]--;\n                        numMatching++;\n                    }\n                    charMap1[char]--;\n                }\n            }\n            \n            return numMatching;\n        }",code:function(e,t){for(var n=0,r={},i={},a=0;a<e.length;a++)r[e[a]]?r[e[a]]++:r[e[a]]=1;for(var o=0;o<t.length;o++)i[t[o]]?i[t[o]]++:i[t[o]]=1;for(var s in console.log(r),console.log(i),r)for(;r[s];)i[s]&&(i[s]--,n++),r[s]--;return n},arguments:{descriptions:[{text:"First String",type:"String"},{text:"Second String",type:"String"}]}},constructRectangle:{name:"constructRectangle",instructions:"A web developer needs to know how to design a web page's size. So, given a specific rectangular web page\u2019s area, your job by now is to design a rectangular web page, whose length L and width W satisfy the following requirements:\n\n        The area of the rectangular web page you designed must equal to the given target area.\n        The width W should not be larger than the length L, which means L >= W.\n        The difference between length L and width W should be as small as possible.\n        Return an array [L, W] where L and W are the length and width of the web page you designed in sequence.",codeOutput:"var constructRectangle = function(area) {\n            //Hold all sets of factors for this area.\n            let factorSets = [];\n            \n            //Find all factors\n            //Do-While structure allows for input of 1 to work. \n            let max = area;\n            let i = 1;\n            do {\n                //See if this is a factor.\n                if(area % i === 0) {\n                    //Make sure longer side is first in set.\n                    factorSets.push([area / i, i]);\n                }\n                //Update max and i.\n                max = Math.ceil(area / i);\n                i++;\n            } while(i < max)\n            \n            //Return the last set in the list (this will have the smallest value of l - w)\n            return factorSets.pop();\n        };",code:function(e){var t=[],n=e,r=1;do{e%r===0&&t.push([e/r,r]),n=Math.ceil(e/r),r++}while(r<n);return t.pop()},arguments:{descriptions:[{text:"Whole Number Area",type:"Number"}]}},constructSquare:{name:"constructSquare",instructions:"Given a string consisting of lowercase English letters, find the largest square number which can be obtained by reordering the string's characters and replacing them with any digits you need (leading zeros are not allowed) where same characters always map to the same digits and different characters always map to different digits.\n\n        If there is no solution, return -1.",codeOutput:'function constructSquare(s) {\n            //Helper function to count occurances of each character.\n            let countDigits = str => {\n                let digits = [];\n                //Until we run out of characters\n                while(str.length) {\n                    //Save the first character\n                    let char = str[0];\n                    //Find the total number of times this character occurs, save that number(push) and remove those characters.\n                    digits.push(str.length - (str = str.replace(new RegExp(char, "g"), "")).length);\n                }\n                return digits.sort((a, b) => b - a).join("");\n            };\n            \n            //Find largest possible square based on rearranging into largest possible number.\n            let charMap = {};\n            let largestUsed = 9;\n            for(let i = 0; i < s.length; i++) {\n                if(!charMap[s[i]]) {\n                    charMap[s[i]] = largestUsed;\n                    largestUsed--;\n                }\n            }\n            let largest = [];\n            for(let i = 0; i < s.length; i++) {\n                largest.push(charMap[s[i]]);\n            }\n            //Get the smallest and largest "possible" values to be squared.\n            let min = Number("1" + Array(Math.floor((s.length - 1) / 2)).fill(0).join(""));\n            let max = Math.ceil(Math.sqrt(Number(largest.sort((a,b) => b - a).join(""))));\n            \n            //Get the count for each digit/character initially.\n            let digits = countDigits(s);\n            \n            //Go through each number, starting at the largest possible.\n            for(let i = max; i >= min; i--) {\n                //See if running countDigits on this number provides the same result as the input string.\n                if(countDigits(String(i * i)) === digits) return i * i;\n            }\n            \n            //No result was found that worked.\n            return -1; \n        }',code:function(e){for(var t=function(e){for(var t=[];e.length;){var n=e[0];t.push(e.length-(e=e.replace(new RegExp(n,"g"),"")).length)}return t.sort((function(e,t){return t-e})).join("")},n={},r=9,i=0;i<e.length;i++)n[e[i]]||(n[e[i]]=r,r--);for(var a=[],o=0;o<e.length;o++)a.push(n[e[o]]);for(var s=Number("1"+Array(Math.floor((e.length-1)/2)).fill(0).join("")),u=Math.ceil(Math.sqrt(Number(a.sort((function(e,t){return t-e})).join("")))),l=t(e),c=u;c>=s;c--)if(t(String(c*c))===l)return c*c;return-1},arguments:{descriptions:[{text:"Lowercase String",type:"String"}]}},contoursShifting:{name:"contoursShifting",instructions:"Mark got a rectangular array matrix for his birthday, and now he's thinking about all the fun things he can do with it. He likes shifting a lot, so he decides to shift all of its i-contours in a clockwise direction if i is even, and counterclockwise if i is odd.\n\n        Here is how Mark defines i-contours:\n        \n        the 0-contour of a rectangular array as the union of left and right columns as well as top and bottom rows;\n        consider the initial matrix without the 0-contour: its 0-contour is the 1-contour of the initial matrix;\n        define 2-contour, 3-contour, etc. in the same manner by removing 0-contours from the obtained arrays.\n        Implement a function that does exactly what Mark wants to do to his matrix.",codeOutput:"function contoursShifting(matrix) {\n            //Helper function to shift array elements\n            const shiftElements = (elements, counterClockwise, rowWidth, colHeight) => {\n                //Put these elements into the correct order for rotation, ONLY if the elements are not coming in as one single row or one single column (in which case we use the same elements array values)\n                let elementsToShift = rowWidth > 1 && colHeight > 1 ? [\n                    ...elements.slice(0, rowWidth),\n                    ...elements.slice(rowWidth, elements.length - rowWidth).filter((element, index) => index % 2),\n                    ...elements.slice(rowWidth * -1).reverse(),\n                    ...elements.slice(rowWidth, elements.length - rowWidth).filter((element, index) => !(index % 2)).reverse()\n                ] : elements;\n                        \n                //Shift to the right if clockwise, otherwise to the left.\n                let removedElement = counterClockwise ? elementsToShift.shift() : elementsToShift.pop();\n                if(counterClockwise) {\n                    elementsToShift.push(removedElement);\n                } else {\n                    elementsToShift.unshift(removedElement);\n                }\n                        \n                //If the elements were rearranged, put them back into order in the same format as the input.\n                if(rowWidth > 1 && colHeight > 1) {\n                    //Find the values that will need to be reshuffled\n                    let sectionSize = (elementsToShift.length - (rowWidth * 2)) / 2;\n                    let section1 = elementsToShift.slice(rowWidth, rowWidth + sectionSize);\n                    let section2 = elementsToShift.slice(sectionSize * -1);\n                    //Reorder the scrambled sections.\n                    let reorderedSections = [];\n                    for(let i = 0; i < section1.length; i++) {\n                        reorderedSections.push(section2[section2.length - 1 - i]);\n                        reorderedSections.push(section1[i]);\n                    }\n                    //Return the reordered array.\n                    return [\n                        ...elementsToShift.slice(0, rowWidth),\n                        ...reorderedSections,\n                        ...elementsToShift.slice(rowWidth + sectionSize, (rowWidth + sectionSize) + rowWidth).reverse()\n                    ];\n                } \n                //Otherwise, return original array.\n                return elementsToShift;\n            };\n            \n            //Initial pointers to array indexes and dimension bounds\n            let start_i = 0; \n            let start_j = 0;\n            let height = matrix.length;\n            let width = matrix[0].length;\n            \n            //Loop through every 'rectangle' in order to extract values, pass to be rotated, and then replaced.\n            while(height >= 1 && width >= 1) {\n                //Extract the elements bordering this rectangle.\n                let elements = [];\n                //Loop over every row in the 'rectangle'\n                for(let i_offset = start_i; i_offset - start_i < height; i_offset++) {\n                    //Loop over every col in the 'rectangle'\n                    for(let j_offset = start_j; j_offset - start_j < width; j_offset++) {\n                        //If this is a top or bottom row, extract all elements.\n                        if(i_offset === start_i || \n                        i_offset === start_i + height - 1 ||\n                        j_offset === start_j ||\n                        j_offset === start_j + width - 1) {\n                            elements.push(matrix[i_offset][j_offset]);\n                        }\n                    }\n                }\n                \n                //Pass these elements, along with the direction value (0 or 1) and row width/height, to be shifted.\n                let shiftedElements = shiftElements(elements, start_i % 2, width, height);\n                        \n                //Traverse this rectangle again, replacing the elements.\n                //Loop over every row in the 'rectangle'\n                for(let i_offset = start_i; i_offset - start_i < height; i_offset++) {\n                    //Loop over every col in the 'rectangle'\n                    for(let j_offset = start_j; j_offset - start_j < width; j_offset++) {\n                        //If this is a top or bottom row, extract all elements.\n                        if(i_offset === start_i || \n                        i_offset === start_i + height - 1 ||\n                        j_offset === start_j ||\n                        j_offset === start_j + width - 1) {\n                            matrix[i_offset][j_offset] = shiftedElements.shift();\n                        }\n                    }\n                }\n                \n                //Update values and move on to next rectangle.\n                start_i++;\n                start_j++;\n                height -= 2;\n                width -= 2;\n            }\n            \n            //Return the final shifted matrix.\n            return matrix;\n        }",code:function(e){for(var t=function(e,t,n,r){var i=n>1&&r>1?[].concat(Object(f.a)(e.slice(0,n)),Object(f.a)(e.slice(n,e.length-n).filter((function(e,t){return t%2}))),Object(f.a)(e.slice(-1*n).reverse()),Object(f.a)(e.slice(n,e.length-n).filter((function(e,t){return!(t%2)})).reverse())):e,a=t?i.shift():i.pop();if(t?i.push(a):i.unshift(a),n>1&&r>1){for(var o=(i.length-2*n)/2,s=i.slice(n,n+o),u=i.slice(-1*o),l=[],c=0;c<s.length;c++)l.push(u[u.length-1-c]),l.push(s[c]);return[].concat(Object(f.a)(i.slice(0,n)),l,Object(f.a)(i.slice(n+o,n+o+n).reverse()))}return i},n=0,r=0,i=e.length,a=e[0].length;i>=1&&a>=1;){for(var o=[],s=n;s-n<i;s++)for(var u=r;u-r<a;u++)s!==n&&s!==n+i-1&&u!==r&&u!==r+a-1||o.push(e[s][u]);for(var l=t(o,n%2,a,i),c=n;c-n<i;c++)for(var h=r;h-r<a;h++)c!==n&&c!==n+i-1&&h!==r&&h!==r+a-1||(e[c][h]=l.shift());n++,r++,i-=2,a-=2}return e},arguments:{descriptions:[{text:"Array of Integer Arrays (Form of [1,2,3], [1,2,3]... * One Space Between Arrays)",type:"NumberArrayArray"}]}},correctNonogram:{name:"correctNonogram",instructions:"A nonogram is also known as Paint by Numbers and Japanese Crossword. The aim in this puzzle is to color the grid into black and white squares. At the top of each column, and at the side of each row, there are sets of one or more numbers which describe the runs of black squares in that row/column in exact order. For example, if you see 10 1 along some column/row, this indicates that there will be a run of exactly ten black squares, followed by one or more white squares, followed by a single black square. The cells along the edges of the grid can also be white.\n\n        You are given a square nonogram of size size. Its grid is given as a square matrix nonogramField of size (size + 1) / 2 + size, where the first (size + 1) / 2 cells of each row and and each column define the numbers for the corresponding row/column, and the rest size \xd7 size cells define the the grid itself.\n        \n        Determine if the given nonogram has been solved correctly.",codeOutput:'function correctNonogram(size, nonogramField) {\n            //Loop through each column of the nonogram, seeing if the rules defined in the first elements are followed in the rest of the grid itself.\n            for(let col = nonogramField[0].length - size; col < nonogramField[0].length; col++) {\n                //Keep track of the \'rules\' in the form of the number of # to be expected in each group.\n                let rules = [];\n                //If inside of a # group, keep track of the number found.\n                let inGroup = false;\n                let groupCount = 0;\n                //Loop over each row of this column index.\n                for(let row = 0; row < nonogramField.length; row++) {\n                    //If this is a number, add to the rules.\n                    if(!isNaN(nonogramField[row][col])) rules.push(nonogramField[row][col]);\n                    //If this is a #, track to see if there are the correct number of # together.\n                    if(nonogramField[row][col] === "#") {\n                        inGroup = true;\n                        groupCount++;\n                    } else if(nonogramField[row][col] === ".") {\n                        //If there is a group counted, see if it follows the current rule.\n                        if(groupCount > 0) {\n                            if(rules[0] != groupCount) {\n                                //Exit the function if the rule isn\'t followed by this group.\n                                return false;\n                            }\n                            //Get rid of this rule, since it was used and now passed.\n                            rules.shift();\n                            //Reset group count.\n                            groupCount = 0;\n                        }\n                    }\n                    //If this is the end and not all groups are accounted for, verify now.\n                    if(row === nonogramField.length - 1 && groupCount) {\n                        //If there is a group count but no rules left, return early.\n                        if(!rules.length) return false;\n                        //Otherwise, verify that the rule is followed.\n                        if(rules[0] != groupCount) return false;\n                        //Clear the (hopefully last) rule.\n                        rules.shift();\n                        //If there are still rules left, this isn\'t a valid column.\n                        if(rules.length) return false;\n                    } \n                }\n            }\n            \n            //Loop through each row of the nonogram, seeing if the rules defined in the first elements are followed in the rest of the grid itself.\n            for(let row = nonogramField.length - size; row < nonogramField.length; row++) {\n                //Keep track of the \'rules\' in the form of the number of # to be expected in each group.\n                let rules = [];\n                //If inside of a # group, keep track of the number found.\n                let inGroup = false;\n                let groupCount = 0;\n                console.log("Looping over row " + row); \n                //Loop over each row of this column index.\n                for(let col = 0; col < nonogramField[row].length; col++) {\n                    //If this is a number, add to the rules.\n                    if(!isNaN(nonogramField[row][col])) rules.push(nonogramField[row][col]);\n                    //If this is a #, track to see if there are the correct number of # together.\n                    if(nonogramField[row][col] === "#") {\n                        inGroup = true;\n                        groupCount++;\n                    } else if(nonogramField[row][col] === ".") {\n                        //If there is a group counted, see if it follows the current rule.\n                        if(groupCount > 0) {\n                            if(rules[0] != groupCount) {\n                                //Exit the function if the rule isn\'t followed by this group.\n                                return false;\n                            }\n                            //Get rid of this rule, since it was used and now passed.\n                            rules.shift();\n                            //Reset group count.\n                            groupCount = 0;\n                        }\n                    }\n                    //If this is the end and not all groups are accounted for, verify now.\n                    if(col === nonogramField[0].length - 1 && groupCount) {\n                        //If there is a group count but no rules left, return early.\n                        if(!rules.length) return false;\n                        //Otherwise, verify that the rule is followed.\n                        if(rules[0] != groupCount) return false;\n                        //Clear the (hopefully last) rule.\n                        rules.shift();\n                        //If there are still rules left, this isn\'t a valid column.\n                        if(rules.length) return false;\n                    } \n                }\n            }\n            \n            return true;\n        }',code:function(e,t){for(var n=t[0].length-e;n<t[0].length;n++)for(var r=[],i=0,a=0;a<t.length;a++){if(isNaN(t[a][n])||r.push(t[a][n]),"#"===t[a][n])!0,i++;else if("."===t[a][n]&&i>0){if(r[0]!=i)return!1;r.shift(),i=0}if(a===t.length-1&&i){if(!r.length)return!1;if(r[0]!=i)return!1;if(r.shift(),r.length)return!1}}for(var o=t.length-e;o<t.length;o++){var s=[],u=0;console.log("Looping over row "+o);for(var l=0;l<t[o].length;l++){if(isNaN(t[o][l])||s.push(t[o][l]),"#"===t[o][l])!0,u++;else if("."===t[o][l]&&u>0){if(s[0]!=u)return!1;s.shift(),u=0}if(l===t[0].length-1&&u){if(!s.length)return!1;if(s[0]!=u)return!1;if(s.shift(),s.length)return!1}}}return!0},arguments:{descriptions:[{text:"Size (Positive Integer)",type:"Number"},{text:'Nonogram Field (Example: ["-","-","-","-","-","-","-","-"], ["-","-","-","2","2","1","-","1"], ["-","-","-","2","1","1","3","3"], ["-","3","1","#","#","#",".","#"], ["-","-","2","#","#",".",".","."], ["-","-","2",".",".",".","#","#"], ["-","1","2","#",".",".","#","#"], ["-","-","5","#","#","#","#","#"])',type:"ArrayArray"}]}},countSumOfTwoRepresentations2:{name:"countSumOfTwoRepresentations2",instructions:"Given integers n, l and r, find the number of ways to represent n as a sum of two integers A and B such that l \u2264 A \u2264 B \u2264 r.",codeOutput:"function countSumOfTwoRepresentations2(n, l, r) {\n            //Keep track of number of working sums.\n            count = 0;\n            //Check if l or r are too large/small and adjust them if needed.\n            if(l + r < n) {\n                l = n - r;\n            } else if(l + r > n) {\n                r = n - l;\n            }\n            //Continue to narrow down l and r until they are equal or l is no longer less than r.\n            while(l <= r) {\n                count++;\n                l++;\n                r--;\n            }\n            return count;\n        }",code:function(e,t,n){var r=0;for(t+n<e?t=e-n:t+n>e&&(n=e-t);t<=n;)r++,t++,n--;return r},arguments:{descriptions:[{text:"Number to Represent n",type:"Number"},{text:"Number to Represent l",type:"Number"},{text:"Number to Represent r",type:"Number"}]}},createAnagram:{name:"createAnagram",instructions:'You are given two strings s and t of the same length, consisting of uppercase English letters. Your task is to find the minimum number of "replacement operations" needed to get some anagram of the string t from the string s. A replacement operation is performed by picking exactly one character from the string s and replacing it by some other character.',codeOutput:"function createAnagram(s, t) {\n            //Create character maps for each string.\n            let sMap = {};\n            let tMap = {};\n            for(let i = 0; i < s.length; i++) {\n                if(sMap[s[i]]) {\n                    sMap[s[i]]++;\n                } else {\n                    sMap[s[i]] = 1;\n                }\n            }\n            for(let i = 0; i < t.length; i++) {\n                if(tMap[t[i]]) {\n                    tMap[t[i]]++;\n                } else {\n                    tMap[t[i]] = 1;\n                }\n            }\n            //Keep track of characters to add or remove.\n            let charsToAdd = [];\n            let charsToRemove = [];\n            for(let character in tMap) {\n                //If a character exists in the first string, add it to the correct array the correct number of times.\n                if(sMap[character]) {\n                    if(tMap[character] - sMap[character] < 0) {\n                        for(let i = 0; i < Math.abs(tMap[character] - sMap[character]); i++) {\n                            charsToRemove.push(character);\n                        }\n                    } else if(tMap[character] - sMap[character] > 0) {\n                        for(let i = 0; i < tMap[character] - sMap[character]; i++) {\n                            charsToAdd.push(character);\n                        }\n                    }\n                    //If this character isn't in the first string, we know we need to add it.\n                } else {\n                    for(let i = 0; i < tMap[character]; i++) {\n                        charsToAdd.push(character);\n                    }\n                }\n            }\n          \n            //If both arrays have the same length, divide the total by 2. Otherwise, return the size of the array of characters needed to be added.\n            return charsToAdd.length === charsToRemove.length ? \n            Math.floor((charsToAdd.length + charsToRemove.length) / 2) :\n            Math.floor(charsToAdd.length);\n        }",code:function(e,t){for(var n={},r={},i=0;i<e.length;i++)n[e[i]]?n[e[i]]++:n[e[i]]=1;for(var a=0;a<t.length;a++)r[t[a]]?r[t[a]]++:r[t[a]]=1;var o=[],s=[];for(var u in r)if(n[u]){if(r[u]-n[u]<0)for(var l=0;l<Math.abs(r[u]-n[u]);l++)s.push(u);else if(r[u]-n[u]>0)for(var c=0;c<r[u]-n[u];c++)o.push(u)}else for(var h=0;h<r[u];h++)o.push(u);return o.length===s.length?Math.floor((o.length+s.length)/2):Math.floor(o.length)},arguments:{descriptions:[{text:"String 's' (Uppercase English Letters)",type:"String"},{text:"String 't' (Uppercase English Letters)",type:"String"}]}},crossingSum:{name:"crossingSum",instructions:"Given a rectangular matrix and integers a and b, consider the union of the ath row and the bth (both 0-based) column of the matrix (i.e. all cells that belong either to the ath row or to the bth column, or to both). Return sum of all elements of that union.",codeOutput:"function crossingSum(matrix, a, b) {\n            //First, add the entire row at index a, then loop through all the columns (index b) except for the one that matches a (to avoid duplicate) and add the sums together.\n            return matrix[a].reduce((sum, current) => sum += current, 0) + \n                   matrix.reduce((sum, current, arrayIndex) => {\n                       if(arrayIndex !== a) return sum += current[b];\n                       return sum;\n                   }, 0);\n        }",code:function(e,t,n){return e[t].reduce((function(e,t){return e+t}),0)+e.reduce((function(e,r,i){return i!==t?e+r[n]:e}),0)},arguments:{descriptions:[{text:"Array of Integer Arrays (Form of [1,2,3], [1,2,3]... * One Space Between Arrays)",type:"NumberArrayArray"},{text:"Integer 'a'",type:"Number"},{text:"Integer 'b'",type:"Number"}]}},crosswordFormation:{name:"crosswordFormation",instructions:"You're a crossword fanatic, and have finally decided to try and create your own. However, you also love symmetry and good design, so you come up with a set of rules they should follow:\n\n        the crossword must contain exactly four words;\n        these four words should form four pairwise intersections;\n        all words must be written either left-to-right or top-to-bottom;\n        the area of the rectangle formed by empty cells inside the intersections isn't equal to zero.\n        Given 4 words, find the number of ways to make a crossword following the above-described rules. Note that two crosswords which differ by rotation are considered different.",codeOutput:"function crosswordFormation(words) {\n            let workingCrossword = 0;\n            \n            //Loop through each possible combination of 4 words to see if it works.\n            for (let first = 0; first < words.length; first++) {\n                for (let second = 0; second < words.length; second++) {\n                    for (let third = 0; third < words.length; third++) {\n                        for (let fourth = 0; fourth < words.length; fourth++) {\n                            if (first != second && first != third && first != fourth && \n                                second != third && second != fourth && third != fourth) {\n                                    workingCrossword += check(words[first],words[second],words[third],words[fourth]); \n                            }\n                        }\n                    } \n                }\n            }\n            \n            return workingCrossword;\n        \n            function check (firstWord, secondWord, thirdWord, fourthWord) {\n                let total = 0;\n                //Loop through indexes of the first word that are 2 away from each other.\n                for (let firstWord_1 = 0; firstWord_1 < firstWord.length; firstWord_1++) {\n                    for (let firstWord_2 = firstWord_1 + 2; firstWord_2 < firstWord.length; firstWord_2++) {\n                        \n                        //Loop through indexes of the second word that are two away from each other.\n                        for (let secondWord_1 = 0; secondWord_1 < secondWord.length; secondWord_1++) {\n                            for (let secondWord_2 = secondWord_1 + 2; secondWord_2 < secondWord.length; secondWord_2++) {\n                                \n                                //Loop through indexes of the third word.\n                                for (let thirdWord_1 = 0; thirdWord_1 